Waktu itu bulan juli, ayah sm ibu ku pigi untk kerjaan gitu, jd ak sndiri dirumah kak, Nah, pas aku mau tidur (fyi aku begadang smpe jam 2 ya kak) aku ngedener suara kyk tik-tik gitu, kyk mukul paku pake palu, nah, pas aku mau otw dari ruang tamu ke kamar aku, PAS BGT DI DEPAN AKU, ADA SOSOK COWO YG TIDAK TERLIHAT DAN TERIAK, abis itu aku lari ke kamar ortu kak, aku kunci, dan ada yg ngetok pelan, tok...tok, aku ragu untuk membukanya, tapi aku buka jg, tp gaada apa apa! Pas aku balik badan..DUARR ada sosok itu, sosok itu badannya hitam, dan kepalanya warna kulit, mukanya pucat, matanya melotot hampir keluar, disitu aku langsung pingsan, pas bangun, aku ada di kamar ku, dan ada ibu, nenek, dan ayah, ternyata aku pinsang selama 2 HARI! Setelah kejadian itu, dipanggil seorang ustadz untuk mendoakan rmh ku, setelah di doakan, alhamdulillah tidak ada kejadian janggal lagi.

